<h3>Ncomparer.com est le site Internet de Eurl
    WAFASSURANCES.</h3>
                                                        <p>Le siège social de WAFASSURANCES est situé : Ensemble Urbain Hai El
                                                            Moudjahidine Bloc B Porte n° 2 Oran Algérie.
                                                            L’agrément en tant que courtier d&#39;assurances, a été attribué par le
                                                            Ministère des Finances, en date du 09 novembre 1998.</p>
<p>Ce site vous permet de faire la comparaison de différents produits
    d&#39;assurance proposés par des compagnies d&#39;assurances ayant un
    protocole d’accord avec le Cabinet WAFASSURANCES. De cette manière,
    vous avez la possibilité de faire une demande d&#39;offre auprès d&#39;une ou
    plusieurs compagnies, de prendre une décision réfléchie et de souscrire
    une police d&#39;assurance auprès de la société de votre choix.</p>
                                                        <p>N comparer.dz compare pour vous des produits et services de différents
                                                            partenaires assureurs. Vous pouvez sur la base de cette comparaison
                                                            choisir de demander une offre personnalisée. Cette comparaison ainsi
                                                            que cette offre seront rédigées à partir des données qui ont été introduit
                                                            par vos soins.</p>
                                                        <p>Recevoir une offre ainsi que l&#39;information qui vous sera montrée ou
                                                            envoyée par e-mail, ne vous confère aucunement le droit à un contrat
                                                            d&#39;assurance avec la compagnie d&#39;assurance. La réception d&#39;une offre ne
                                                            signifie donc pas automatiquement que la compagnie d&#39;assurance
                                                            accepte d&#39;assurer le risque. Après évaluation de la proposition
                                                            d&#39;assurance que vous soumettez à la compagnie d&#39;assurance, il sera mis
                                                            en évidence si l&#39;assureur accepte le risque et à quelles conditions. Les
                                                            conditions générales et particulières de la police sont les seules
                                                            véritables bases juridiques du contrat d&#39;assurance.</p>
                                                        <p>N comparer.dz compare une série de produits sur la base de données
                                                            introduites par vos soins. N comparer.dz cherchera toujours à présenter
                                                            un échantillon de produits représentatifs des différents partenaires
                                                            assureurs lors de cette comparaison. WAFASSURANCES ne peut être

                                                            tenu responsable de l&#39;absence d&#39;une proposition ou comparaison, ou s&#39;il
                                                            semble que sur base de vos données, aucune solution possible n&#39;est
                                                            présentée.</p>

                                                        <p>Suite à l&#39;utilisation de la technologie internet et de la présentation de la
                                                            majorité des propositions sur un écran, il est impossible de présenter
                                                            tous les détails de chacune des solutions possibles. Une offre écrite vous
                                                            permettra d&#39;avoir une vue complète sur la solution de votre choix. Il est
                                                            donc indispensable de lire les conditions générales et particulières afin
                                                            d&#39;avoir une image détaillée de la solution proposée. WAFASSURANCES ne
                                                            peut en aucun cas être tenu responsable des choix qui ont été faits et
                                                            basés sur des informations apparaissant à l&#39;écran sur base d&#39;une
                                                            documentation partielle.</p>
                                                        <p>N comparer.dz renvoie vers et a des liens vers d&#39;autres sites Internet.
                                                            WAFASSURANCES ne peut être tenu responsable de l&#39;exactitude et de
                                                            l&#39;authenticité des informations présentes sur ces sites.</p>
                                                        <p>
                                                            Nous nous efforçons que N comparer.dz soit disponible 7 jours sur 7 et
                                                            24h sur 24. Nous nous réservons cependant le droit, et ce à tout
                                                            moment, et sans notification préalable d&#39;interrompre l&#39;accès au site pour
                                                            des raisons techniques ou autres (ex: mise à jour du site). Dans la mesure
                                                            du possible ces interruptions auront lieu à des moments creux afin de ne
                                                            pas nuire aux internautes. Nous nous réservons également le droit
                                                            d&#39;interrompre la disponibilité du site pour une durée indéterminée.
                                                            WAFASSURANCES ne peut être tenu responsable des conséquences
                                                            éventuelles de ces interruptions.
                                                        </p>
                                                        <p>Nous nous réservons le droit d&#39;interdire de manière unilatérale l&#39;accès du
                                                            site ou d&#39;une partie du site à toute personne physique ou société
                                                            anonyme qui enfreindrait les conditions générales du site (proposition
                                                            d&#39;autres produits ou services, utilisation non réglementaire d&#39;adresses
                                                            email,...).</p>
                                                        <p>WAFASSURANCES est également libre d&#39;éventuellement engager des
                                                            poursuites judiciaires.</p>
                                                        <p>La Loi Algérienne est d&#39;application sur le site N comparer.dz, c&#39;est
                                                            pourquoi chaque conflit éventuel en rapport avec WAFASSURANCES sera
                                                            réglé par les tribunaux Algériens.</p>
